import React from 'react';
import c from './MyPosts.module.css';

function MyPosts() {
  return (
    <div className={c.content}>
      <div>My Posts</div>
      <div>New Post</div>
      <div>Post 1</div>
      <div>Post 2</div>
    </div>
  );
}

export default MyPosts;
